def good(a):
	vis = [[False]*8 for _ in range(8)]
	vis[0][0] = True
	if a[0] != (0, 0):
		return False
	if a[-1] != (7, 7):
		return False
	for i in range(1,len(a)):
		x1, y1 = a[i-1]
		x2, y2 = a[i]
		if vis[x2][y2]:
			return False
		if x1 == x2 or y1 == y2:
			vis[x2][y2] = True
		else:
			return False
	return True

